                <TableCell align="center">{row.deluxe}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
            {/* === === === === === === TABLE CONTAINER === === === === === === ===  */}
            <TableContainer component={Paper}>
        <Divider>
          <Typography
            variant="h6"
            sx={{
              fontWeight: 700,
            }}
          >
